import React from "react";
import Socials from "./Socials";
import About from "./About";
import "./Layout.css";

export default function Layout() {
  return (
    <section className="mt-5 container-fluid d-flex justify-content-center">
      <div
        id="layout"
        className="sm-w-50 md-w-60 justify-content-between d-flex p-5"
      >
        <Socials />
        <About />
      </div>
    </section>
  );
}
